import axios from "axios";

export async function fetchColumnNames(csvFileName: string): Promise<string[]> {
  try {
    const response = await axios.post(
      "http://127.0.0.1:8000/api/csv-header/",
      { csv_file_name: "data.csv" },
      {
        withCredentials: false,
        headers: {
          "Access-Control-Allow-Origin": "http://localhost:8000", // Replace with the URL of your Django backend server
        },
      }
    );
    const { column_names } = response.data;
    console.log(response.data);
    return column_names;
  } catch (error) {
    throw new Error("Failed to fetch column names.");
  }
}
